--biblioteca
alter table exemplar add bi23_exemplar int;

create or replace function proximo_exemplar(iAcervo int)
returns int as $$

  declare
    iProximo int;
  begin

    SELECT coalesce(max(bi23_exemplar), 0) + 1 INTO iProximo
      FROM exemplar
     WHERE bi23_acervo = $1;

  return iProximo;
  end;
$$ language 'plpgsql';

update exemplar
   set bi23_exemplar = (select proximo_exemplar(x.bi23_acervo::int))::int
  from exemplar as x
 where exemplar.bi23_codigo = x.bi23_codigo;

alter table exemplar alter column bi23_exemplar set not null;
